-- Procedimientos
--
DROP PROCEDURE IF EXISTS `crearReservaHotel`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `crearReservaHotel` (IN `consecutivoReserva` VARCHAR(6), IN `hora` TIME, IN `fecha_ingreso` DATE, IN `fecha_salida` DATE, IN `usuario` INT(11), IN `reservaHabitacion` VARCHAR(4))  BEGIN
  DECLARE verificarReserva varchar(6);
  DECLARE cantidadHabitaciones int(11);
  DECLARE totalHabitaciones int(11);
  DECLARE diasReservados int(11);
  DECLARE precioHabitacion decimal(8,3);
  DECLARE totalAPagar decimal(8,3);

    SELECT consecutivo FROM reserva WHERE consecutivo=consecutivoReserva INTO verificarReserva;
  
    SELECT cantidad FROM habitacion WHERE codigo=reservaHabitacion INTO cantidadHabitaciones;

  IF(verificarReserva=consecutivoReserva) THEN
  SELECT 'La reserva ya existe' Advertencia;

  ELSE

  	IF(cantidadHabitaciones<=0) THEN
  	SELECT 'Habitaci贸n no disponible' Advertencia;

 	ELSE
		
		SET totalHabitaciones=cantidadHabitaciones-1;
		UPDATE habitacion set cantidad=totalHabitaciones WHERE codigo=reservaHabitacion;

  		  		SELECT DATEDIFF(fecha_salida,fecha_ingreso) INTO diasReservados;

  		SELECT precio FROM habitacion WHERE codigo=reservaHabitacion INTO precioHabitacion;

  		SET totalAPagar=precioHabitacion*(diasReservados+1);

				INSERT INTO reserva VALUES (consecutivoReserva,hora,fecha_ingreso,fecha_salida,usuario);

		INSERT INTO reservaHotel VALUES (consecutivoReserva,reservaHabitacion,totalAPagar);
	END IF;

  END IF;

  
  SELECT rh.reserva reserva, u.nombre, ho.descripcion hotel, h.descripcion habitacion,
  h.precio precioHabitacion, DATEDIFF(r.fechaSalida,r.fechaIngreso)+1 diasReservados,
  rh.precio totalAPagar, r.hora HoraIngreso
  FROM usuarios u, reserva r, reservaHotel rh, habitacion h, hotel ho 
  WHERE u.idUsuarios=r.usuario AND r.consecutivo=rh.reserva 
  AND rh.habitacion=h.codigo AND h.hotel=ho.codigo ORDER BY reserva ASC;

END$$

DELIMITER ;

