DELIMITER $$
CREATE TRIGGER `restaurarHabitaciones` AFTER DELETE ON `reservahotel` FOR EACH ROW BEGIN

	DECLARE disponibles int(11);
	DECLARE totalHabitaciones int(11);

		SELECT cantidad FROM habitacion WHERE codigo=old.habitacion INTO disponibles;
		SET totalHabitaciones=disponibles+1;

	UPDATE habitacion set cantidad=totalHabitaciones WHERE codigo=old.habitacion;

END
$$
DELIMITER ;

